import React from 'react';
import "./Home.css";
import { Link } from "react-router-dom";
import bitcoin from "../images/bitcoin.png";
import ethereum from "../images/ethereum.png";
import realEstate from "../images/realEstate.jpg"

const Home = () => {
  return (
    <div className='home-page-container'>
      <section className='home-page-introductory-section'>
        <h1 className='home-page-title'>Investment Securities</h1>
        <p className='home-first-paragraph'>
        Instead of you working to make money, make your money work for you. Hence, if you want to make money and get richer , invest your money in <span>cryptocurrencies</span>, <span>stocks</span>, <span>real estate</span>, <span>bonds</span>, and <span>other securities</span>. Perhaps you may need <span className='span-tech'>technical advice</span> on <span className='span'>where</span>, <span className='span'>how</span> and <span className='span'>when</span> to invest. LisaConsult is here for you to make your dream come true. Just click the <Link to="/services"> Registration Form</Link> to register faster for the course and you will enjoy an amazing life for the rest of your life.
        </p>

        <figure className='homepage-title-images'>
          <Link to="/"> <img className='bitcoin' src={bitcoin} alt="Bitcoin" /> </Link>
          <Link to="/"> <img class src={ethereum} alt="Old-Coin" /> </Link>
          <Link to="/"> <img src={realEstate} alt="Real Estate" /> </Link>
        </figure>
      </section>
    </div>


  )
}

export default Home
